// components/PrivateRoute.jsx
import { Navigate } from "react-router-dom";

export default function PrivateRoute({ element }) {
  const user = JSON.parse(localStorage.getItem("user"));
  if (!user || !user.token) {
    return <Navigate to="/login" replace />;
  }
  return element;
}
